	  262358,"1",15447,437,1968,
	  "0.25 USD",68.000,"bi-monthly","The Cowsills is an American singing group from Newport Rhode Island. They specialized in harmonies and the ability to sing and play music at an early age. The band was formed in the spring of 1965 by brothers Bill Bob and Barry; they shortly thereafter added John. Originally Bill and Bob played guitar and Barry was on drums. When John learned how to play drums and joined the band Barry went to bass. After their initial success the brothers were joined by their siblings Susan and Paul and their mother Barbara. Bob's twin brother Richard was the road manager. When the group expanded to its full family membership by 1967 the six siblings ranged in age from 8 to 19. Joined by their mother Barbara (ne Russell) the Cowsills were the inspiration for the 1970 launch of the television show The Partridge Family.The Cowsills. (2013 April 27). In Wikipedia The Free Encyclopedia. Retrieved 17:26 April 28 2013 from http://en.wikipedia.org/w/index.php?title=The_Cowsills&oldid=552364854Indicia: HARVEY POP COMICS presents THE COWSILLS OCTOBER 1968 VOL. 1 NO. 1 IS PUBLISHED BI-MONTHLY by HARVEY PUBLICATIONS INC. Editorial Advertising and Executive Offices 1860 Broadway New York 10023 N.Y. President Alfred Harvey; Vice-President and Editor Leon Harvey; Vice-President and Business Manager Robert B. Harvey. Application for second class entry pending at Sparta Ill. under the act of March 3 1879. Single copies 25c 35c in Canada. Copyright  1968. Cowsills-Stogel Inc. Produced and designed by Harvey Features Syndicate New York N.Y. All rights reserved. This periodical may not be sold except by authorized dealers and is sold subject to the conditions that it shall not be sold or distributed with any part of its cover or markings removed nor in a mutilated condition nor affixed to nor as part of any advertising literary or pictorial matter whatsoever.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  262359,"2",15447,437,1969,
	  "0.25 USD",68.000,"Bi-Monthly","Indicia: HARVEY POP COMICS: ROCK HAPPENING NOVEMBER 1969 VOL. 1 NO. 2 IS PUBLISHED BI-MONTHLY by HARVEY PUBLICATIONS INC. Sparta Illinois. Editorial Advertising and Executive Offices 1860 Broadway New York 10023 N.Y. President Alfred Harvey; Vice-President and Editor Leon Harvey; Vice-President and Business Manager Robert B. Harvey. Application for second class entry pending at Sparta Illinois under the act of March 3 1879. Single copies 25c 35c in Canada. Copyright  Harvey Features Syndicate 1969. All rights reserved. Printed in the U.S.A. This periodical may not be sold except by authorized dealers and is sold subject to the conditions that it shall not be sold or distributed with any part of its cover or markings removed nor in a mutilated condition nor affixed to nor as part of any advertising literary or pictorial matter whatsoever.This issue is a tie-in with the ongoing BUNNY series published by Harvey from 1966-1971 (with a belated final issue appearing five years later). The house ads and fan club pages are identical to those published in BUNNY. Hy Eisman was credited with the art in BUNNY.  Although Bunny Ball is a featured character ROCK HAPPENING highlights the fictional rock groups that were supporting characters in the BUNNY series -- The Soular System (loosely based on The 5th Dimension and Sly And The Family Stone) The Beagles (The Beatles) and The Marmalade Mirage (based on The Mamas And The Papas).",
