	  262483,NULL,15489,4248,1942,
	  "0.10 USD",52.000,NULL,"Notation about the indicia publisher: The indicia lists Parents' Institute Inc. only. However based on the research of Elena Hristove in her dissertation from the University of Sussex (UK) \"Imagining Brotherhood: The Comics of the American Jewish Committee 1941-1946\" (no date circa 2010 retrieved 10 November 2014: http://sro.sussex.ac.uk/44211/1/Hristova_Elena.pdf) the actual producer of comics was done by the War Services Division of Parents' Institute Inc. and is included in brackets here for historical accuracy. On sale date from the publication date as reported to the U.S. Copyright Office in the Catalog of Copyright Entries; Part 1; Books; Group 2; Pamphlets Leaflets Contributions to Newspapers of Periodicals etc. Lectures Sermons Address for Oral Delivery and Maps; 1943 New Series Volume 40 Number 4. Submitted as a book. Copyright registration number AA 425234.All proceeds went to buy War Bonds.Copyright 1942 The Parents' Institute Inc. Printed in U.S.A.Only copyright date listed in comic. Date is confirmed based on the contents of a letter dated January 20 1943 sent by Parents' Institute President George J. Hecht to Dr. Wilbur Schramm head of the Division of Educational Services within the Office of War Information.Copy located in the United States National Archives Record Group 44 (Office of Government Reports) entry # PI-35 146: General Records 1942-July 1 1943 (Office for Emergency Management. Office of War Information. Domestic Operations Branch. Bureau of Publications. Division of Educational Services.) Box #1694 Folder: \"Correspondences: Division of Educational Services\".",
