	  263619,NULL,15690,2,2001,
	  "2.95 USD; 4.95 CAD",52.000,NULL,"Credits for this issue are from Bob Hughes who documented his latest thoughts on the credits for the original of this issue on the DC Message Boards on 2007-11-04.  He also was the source of the credits as printed in this Millennium Edition which are now superseded by his latest thoughts.  This issue was selected for reprinting by readers in online voting for Millennium Editions.  There is no note on its cover to indicate the election while all other winners carry a notation.",
