	  263620,NULL,15691,2,2000,
	  "3.95 USD; 6.25 CAD",68.000,NULL,"This edition is missing the following from the original 1939 edition of Superman #1: a house ad for Action Comics 1/3 page fillers at the end of the third fourth and fifth story sequences; and ads from the inside front cover and inside back cover.  Some sequences were moved as noted below.  Whitney Ellsworth is incorrectly attributed as the original series editor in this reprint.",
