	  "0.50 USD",52.000,NULL,"The on-sale date is the publication date reported in the U. S. Copyright Office filing.The indicia title for this issue is The Collected Freak Brothers.Underground Comix are known for using different prices covers (art or color variations) and/or interior content to distinguish between printings. 1st-10th printings have 0.50 USD cover prices with multiple variations in color for different objects.1st-3rd printings have purple price and other cover color variations.4th-10th printings have blue price and other cover color variations.7th print is a German language edition.9th print is a pink paper edition.11th print has 0.60 USD cover price.12th-13th print have 0.75 USD cover price. 13th print is left over 9th print interiors with new cover.14th print has 1.00 USD cover price. 15th print has 1.25 USD cover price. 16th print has 1.50 cover price.17th print has 2.00 USD cover price. 18th print has 2.95 USD cover price.19th print has 3.25 USD cover price. 20th print has 3.95 USD cover price.",
