	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  265894,"3",16000,216,1942,
	  "0.10 USD",52.000,NULL,"All data from Eric Schumacher (December 8 2005). This book doesn't contain a text story.Full indicia [print quality is poor and the 5 in 45 is a rather dense smudge even in a clear scan- possibly some other number]:CAPTAIN BATTLE published by Magazine Press 45? East 17th Street New York N. Y. Printed in U. S. A.This is a particularly strange issue to be connected to Chesler despite the Chesler Syndicate mark on the cover.  It consists of reprints of Silver Streak issues published by Your Guide Publications Inc. or Lev Gleason's Comic House Inc.  Of the reprinted issues the earliest are believed to have been produced by Funnies Inc.  while the later issues seem likely to have been produced by the Binder studio (which admittedly featured many Chesler alumni including studio head Jack Binder) or by freelancers or in-house staff.  None of this material appears to be the direct product of the Chesler shop although it is difficult to make such statements with confidence.",
	  NULL,NULL,NULL,NULL,NULL,NULL
